import Aff from "./Afficher";
export default function Sci_fi(props){
    return(
        <div className="con">
            {
                props.movie.filter((sci)=>{
                    return sci.Genre==='Sci-Fi'
                }).map((mov,i)=>{
                    return <Aff movie={mov} key={i} />
                })
            }
        </div>
    )
}
